Storyline:

     Young lawyer Tod Jackson arrives in pioneer Kansas to visit his prosperous rancher friends the Daltons, just as the latter are in danger of losing their land to a crooked development company. When Tod tries to help them, a faked murder charge turns the Daltons into outlaws, but more victims than villains in this fictionalized version. Will Tod stay loyal to his friends despite falling in love with Bob Dalton's former fiancee Julie?



